// SPDX-License-Identifier: MIT
import "@openzeppelin/contracts/token/ERC1155/ERC1155.sol";
import "@openzeppelin/contracts/token/ERC1155/extensions/IERC1155MetadataURI.sol";
import "@openzeppelin/contracts/token/ERC1155/extensions/ERC1155Burnable.sol";
import "@openzeppelin/contracts/utils/Counters.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

pragma solidity ^0.8.0;


contract CryptoRevolution is ERC1155Burnable, Ownable
{
    event TokenMinted(address indexed _from, uint8 indexed _id, uint256 tokenID);

    enum NFT_Types
    {
        VISITOR,
        VISITOR_VISITED,
        VIP,
        VIP_VISITED,
        SPONSOR,
        SPONSOR_VISITED,
        LECTURER,
        LECTURER_VISITED
    }

    mapping (address => bool) private knownAddresses;

    address[] private tokenOwners;
    mapping (address => uint16[]) private ownerToTokens;

    using Counters for Counters.Counter;
    Counters.Counter private _tokenIds;

    constructor() ERC1155("https://gateway.pinata.cloud/ipfs/QmTTso1E4SVeJrPUkMZqQTqMb3vcHMBBQtQ2gAiuJFx2Gc/{id}.json")
    {
    }

    function mintNFT(address recipient, uint8 nft_type)
        public onlyOwner()
        returns (uint256)
    {
        require((nft_type >= uint(NFT_Types.VISITOR) &&
                    nft_type <= uint(NFT_Types.LECTURER_VISITED)), "Mint token level is incorrect");

        _mint(recipient, nft_type, 1, "");
        if (knownAddresses[recipient] == false)
        {
            knownAddresses[recipient] = true;
            tokenOwners.push(recipient);
        }

        ownerToTokens[recipient].push(nft_type);
        uint256 tokenId = _tokenIds.current();
        _tokenIds.increment();

        emit TokenMinted(recipient, nft_type, tokenId);
        return tokenId;
    }

    function getNFTOwners()
        public view  returns (address[] memory)
    {
        return tokenOwners;
    }

    function getOwnerNFTs(address owner)
        public view  returns (uint16[] memory)
    {
        return ownerToTokens[owner];
    }

    modifier only_not_visited_token(uint8 tokenID) {
        require( (tokenID == uint(NFT_Types.VISITOR) ||
                    tokenID == uint(NFT_Types.VIP) ||
                    tokenID == uint(NFT_Types.SPONSOR) ||
                    tokenID == uint(NFT_Types.LECTURER)),
                    "Trying to convert unconvertable token");
        _;
    }

    function removeToken(uint8 nft_type, address recipient) private {
        uint index = 0;
        for (uint i = 0; i < ownerToTokens[recipient].length; i++)
        {
            if (ownerToTokens[recipient][i] == nft_type)
            {
                index = i;
                break;
            }
        }

        for(uint i = index; i < ownerToTokens[recipient].length-1; i++)
        {
            ownerToTokens[recipient][i] = ownerToTokens[recipient][i+1];
        }
        ownerToTokens[recipient].pop();
    }

    function convertNFT(address recipient, uint8 nft_type)
        public only_not_visited_token(nft_type)
        returns (uint256)
    {
        require(msg.sender == recipient || msg.sender == owner(),
                "Sender address does not have permissions to convert");
        require(balanceOf(recipient, nft_type) != 0, "Recipient does not own this initial token");
        _burn(recipient, nft_type, 1);
        removeToken(nft_type, recipient);

        require((nft_type+1 >= uint(NFT_Types.VISITOR) &&
                nft_type+1 <= uint(NFT_Types.LECTURER_VISITED)), "Mint token level is incorrect");

        _mint(recipient, nft_type+1, 1, "");
        if (knownAddresses[recipient] == false)
        {
            knownAddresses[recipient] = true;
            tokenOwners.push(recipient);
        }

        ownerToTokens[recipient].push(nft_type+1);
        uint256 tokenId = _tokenIds.current();
        _tokenIds.increment();

        emit TokenMinted(recipient, nft_type+1, tokenId);
        return tokenId;
    }
}
